/**
 * @fileoverview App navigation module.
 */


/**
 * Replaces the url history state to reflect the changes upon navigation from a different screen.
 * @param {String} requestId - id of the selected request.
 */
function replaceUrlForRequestDetails(requestId) {
  var state = {
    'timestamp': new Date().getTime()
  };
  var params = {
    requestId: requestId
  };

  google.script.history.replace(state, params, app.pages.EditRequest.name);
}


/**
 * Performs redirect to EditRequest page passing request id
 *     as a parameter.
 *
 * @param {String} requestId - id of the selected request;
 */
function goToRequestDetailsPage(requestId) {
  var requestDetailsPage = app.pages.EditRequest;
  requestDetailsPage.properties.requestId = requestId;
  app.showPage(requestDetailsPage);
  replaceUrlForRequestDetails(requestId);
}
